import React from 'react';

import {ItemViewer} from './ItemViewer'




export class Search extends React.Component {
	constructor(props){
		super(props);
	}
	
	
	
	render(){
		
		let path = window.location.pathname;
		let path_split = path.split("/");
		let search_term = "";
		
		if(path_split.length >= 2){
			search_term = "search=" + path_split[1];
		};
		
		let search = this.props.search + "?" + {search_term} +"sold=false";
		
		return (
			<div>
				<div class="default-text-large">
					Enjoy searching!
				</div>
				
				
				<ItemViewer search={this.props.search + "?" + {search_term} +"sold=false"}/>
				
				
				{path_split[1]}
				
			</div>
		);
	};
		
	
}
